import React, { useState, useEffect } from "react";
import Container from "@mui/material/Container";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/joy/Button";
import ButtonBase from "@mui/material/ButtonBase";
import TextField from "@mui/material/TextField";
import Divider from "@mui/material/Divider";
import PersonIcon from "@mui/icons-material/Person";
import ShareIcon from "@mui/icons-material/Share";
import ModeIcon from "@mui/icons-material/Mode";
import ClearIcon from "@mui/icons-material/Clear";
import axios from "axios";
import { useCookies } from "react-cookie";
import { useNavigate } from "react-router-dom";

async function creaAppartamento() {
  axios
    .post("http://localhost:3002/apartments", {
      name: "appartamento2",
      description: "descrizione",
      admin: "username",
      users: ["username"],
      expanses: [],
    })
    .then((response) => {
      console.log(response);
    })
    .catch((error) => {
      console.log(error);
    });
}

async function agggiungiAppartamento(id) {
  console.log("ID appartamento:", id);
  // Qui aggiungi il resto della logica per aggiungere l'appartamento
}

export default function Appartamenti() {
  const [cookies, setCookie] = useCookies(["session"]);
  const navigate = useNavigate();
  const [apartments, setApartments] = useState([]);
  const [appartmentID, setAppartmentID] = useState("");
  const [render, setRender] = useState(false);

  useEffect(() => {
    if (cookies && Object.keys(cookies).length > 0) {
    } else {
      navigate("/", { replace: true });
    }
  }, [cookies]);

  useEffect(() => {
    axios
      .get("http://localhost:3002/apartments")
      .then((response) => {
        console.log(response);
        setApartments(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, [render]);

  const handleAppartmentIDChange = (event) => {
    setAppartmentID(event.target.value);
  };

  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <Container
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "100vh",
          width: "100vw",
        }}
      >
        <Container
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            height: "95vh",
            width: "100vw",
            backgroundColor: "rgb(203, 231, 253)",
            borderRadius: "5vh",
          }}
        >
          <Grid
            container
            spacing={1}
            justifyContent="center"
            alignItems="center"
            sx={{ flexGrow: 1 }}
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              height: "95%",
              width: "95%",
            }}
          >
            {/* Codice per la visualizzazione degli appartamenti */}
            <Grid
              container
              direction="column"
              justifyContent="center"
              alignItems="center"
              style={{
                width: "90%",
                height: "50%",
              }}
            >
              <Grid
                container
                direction="column"
                justifyContent="flex-end"
                alignItems="center"
                style={{
                  width: "90%",
                  height: "40%",
                }}
              >
                <Button
                  variant="solid"
                  style={{ background: "rgb(0, 76, 134)" }}
                  onClick={async () => {
                    creaAppartamento();
                    setRender(!render);
                  }}
                >
                  Crea nuovo appartamento
                </Button>
                <Grid
                  style={{
                    width: "90%",
                    height: "10%",
                  }}
                ></Grid>
              </Grid>
              <Divider flexItem />
              <Grid
                container
                direction="column"
                justifyContent="flex-start"
                alignItems="center"
                style={{
                  width: "90%",
                  height: "50%",
                }}
              >
                <Grid
                  style={{
                    width: "90%",
                    height: "5%",
                  }}
                ></Grid>
                <TextField
                  id="appartmentID"
                  label="Codice identificativo"
                  variant="standard"
                  value={appartmentID}
                  onChange={handleAppartmentIDChange}
                />
                <Grid
                  style={{
                    width: "90%",
                    height: "5%",
                  }}
                ></Grid>
                <Button
                  variant="solid"
                  style={{ background: "rgb(0, 76, 134)" }}
                  onClick={async () => {
                    await agggiungiAppartamento(appartmentID);
                  }}
                >
                  Unisciti nuovo appartamento
                </Button>
              </Grid>
            </Grid>
          </Grid>
        </Container>
      </Container>
    </div>
  );
}
